import React, { Component } from "react";
import icon from "../image/onepunchman.png";

class HeaderComponent extends Component {
  render() {
    const webIconStyle = {
      color: "black",
      fontSize: "36px",
    };

    const headerStyle = {
      backgroundColor: "orange",
    };

    return (
      <div>
        <header style={headerStyle}>
          <div class="container">
            <div class="row">
              <div class="col-4">
                <div class="web-icon">
                  <span style={webIconStyle} class="rubik-dirt-font">
                    MangaPunch
                  </span>
                  <span>
                    <img
                      src={icon}
                      alt="onepunch-icon"
                      style={{ width: "78px" }}
                    ></img>
                  </span>
                </div>
              </div>
              <div class="col-4">
                <div class="search-box input-group">
                  <input
                    type="text"
                    class="form-control"
                    placeholder="Username"
                    aria-label="Username"
                    aria-describedby="basic-addon1"
                  ></input>

                  <span
                    class="material-symbols-outlined"
                    id="basic-addon1"
                  >
                    search
                  </span>
                </div>
              </div>
              <div class="col-4"></div>
            </div>
          </div>
        </header>
      </div>
    );
  }
}

export default HeaderComponent;
